Best Wishes!
RGB888 -> RGB454 -> YUV420 -> YUV : Y[0,13] U[-2,5] [-6,5] ;
But if you want to achieve the advance texture compression like ASTC or PVRTC2,the important issue is that how to fast store(code) data.

