const vec2 Size = vec2(42.,44.);
const float ChunkSize = 2.;
const vec3 OffSet = vec3(0.,-2,-6);
const vec2 clampSize = vec2(80.,88.);

vec3 RGB(vec3 YUV){
   	YUV += OffSet;
    return vec3(
    	1.164062 * YUV.x + 1.597656 * YUV.z + 0.5,
		1.164062 * YUV.x - 0.390625 * YUV.y - 0.8125 * YUV.z + 0.5,
		1.164062 * YUV.x + 2.015625 * YUV.y + 0.5);
}
void mainImage( out vec4 col, in vec2 u )
{
    vec2 R = iResolution.xy;
    vec4 c = vec4(0.);
    u.y = R.y - u.y-R.y/50.;
    u.x -= R.x/4.5;
    u /= (R.y/90.);
    if(0.<u.x && u.x<clampSize.x+4. && 0.<u.y && u.y<clampSize.y -1.){
	    c = texture(iChannel0,u/R,0.);
        c.rgb = RGB(c.rgb)*0.0625;
    }
    col = vec4(c.rgb,0.);

}

