const vec3 OffSet = vec3(0.,-2,-6);

vec3 RGB(vec3 YUV){
   	YUV += OffSet;
    return vec3(
    	1.164062 * YUV.x + 1.597656 * YUV.z + 0.5,
		1.164062 * YUV.x - 0.390625 * YUV.y - 0.8125 * YUV.z + 0.5,
		1.164062 * YUV.x + 2.015625 * YUV.y + 0.5);
}
float GetLum(float n,float i){
	return mod(floor(n/exp2(i*4.)),16.);
}
vec2 GetCbCr(float n){
	return vec2(
    	mod(floor(n/65536.),16.),
        floor(n/1048576.));
}

